	('8d18b61d-e53e-49f5-9328-3562d68407fd', 'Starter Bundle', 'Perfect for newcomers to the Reform UK movement. This starter bundle includes our signature T-shirt, cap, and mug, giving you everything you need to show your support.', 34.99, true, '2025-08-31 02:49:05.859517+00', '2025-08-31 02:49:05.859517+00', 44.97, 'starter', NULL, NULL, 'Free UK Shipping', 'Limited Time Offer', 4.80, 156, '{"High-quality cotton T-shirt with Reform UK branding","Adjustable cap with Reform UK logo","Ceramic mug with Reform UK branding","Great value bundle with significant savings","Perfect introduction to Reform UK merchandise","Free UK shipping included","30-day money-back guarantee"}', 'Machine wash T-shirt at 30°C. Hand wash cap and mug. Mug is dishwasher and microwave safe.', 'Premium cotton T-shirt, adjustable cap, and ceramic mug', true, 1),
	('740f30cf-67b8-4f22-a511-c53a7805377e', 'Champion Bundle', 'For the dedicated Reform UK supporter. This champion bundle includes a premium hoodie, tote bag, water bottle, and mouse pad - everything you need to show your commitment to the movement in style and comfort.', 99.99, true, '2025-08-31 02:49:05.859517+00', '2025-08-31 02:49:05.859517+00', 114.96, 'champion', NULL, NULL, 'Free UK Shipping', 'Limited Time Offer', 4.90, 203, '{"Premium cotton hoodie with Reform UK branding","Durable canvas tote bag for daily use","Stainless steel water bottle keeps drinks cold for 24 hours","High-quality mouse pad for desk setup","Excellent value bundle with significant savings","Perfect for active supporters","Free UK shipping included","30-day money-back guarantee"}', 'Machine wash hoodie at 30°C. Tote bag spot clean. Water bottle dishwasher safe.', 'Premium cotton hoodie, durable canvas tote bag, stainless steel water bottle, and high-quality mouse pad', true, 2),
	('7756b91d-02dc-451e-bfcc-4d8c5e62ddf9', 'Activist Bundle', 'The ultimate bundle for Reform UK activists. This comprehensive collection includes a premium hoodie, T-shirt, cap, tote bag, water bottle, mug, and mouse pad - everything you need to make a statement and show your commitment to the movement.', 169.99, true, '2025-08-31 02:49:05.859517+00', '2025-08-31 02:49:05.859517+00', 194.91, 'activist', NULL, NULL, 'Free UK Shipping', 'Limited Time Offer', 4.90, 156, '{"Premium cotton hoodie with Reform UK branding","Comfortable cotton T-shirt for everyday wear","Adjustable cap for perfect fit","Durable canvas tote bag for daily use","Stainless steel water bottle keeps drinks cold for 24 hours","Ceramic mug perfect for home or office","High-quality mouse pad for desk setup","Complete activist starter kit","Excellent value bundle with significant savings","Free UK shipping included","30-day money-back guarantee"}', 'Machine wash hoodie and T-shirt at 30°C. Cap can be hand washed. Tote bag spot clean. Water bottle dishwasher safe. Mug dishwasher safe.', 'Premium cotton hoodie and T-shirt, adjustable cap, durable canvas tote bag, stainless steel water bottle, ceramic mug, and high-quality mouse pad', false, 3);
